import React from 'react';
import s from './Navbar.module.css';

const Navbar = () => {
    return (
      <nav className={s.nav}>
      <div>
        <a href='/Profile'>Profile</a>
        </div>
        <div>
        <a href='/Dialogs'>Messages</a>
        </div>
        <div>
        <a href='#s'>News</a>
        </div>
        <div>
        <a href='#s'>Music</a>
        </div>
        <div>
        <a href='#s'>Settings</a>
        </div>

    </nav>
    );
}
export default Navbar;
